import db from "../firebase";
import { ref, get, remove, push } from "firebase/database";

const dbRef = ref(db, "/stars");

const getAllStars = () => {
  return get(dbRef);
};
const addBike = (brand, model) => {
  return push(dbRef, {
    brand: brand,
    model: model
  });
};

export default {
  getAllStars,
  addBike
};
